import React, { Component } from "react";
class Menu extends Component {
  constructor(props) {
    super(props);
    this.state = {
      menuState: "All Deals",
      subMenuState: "Deal of Day",
      mobileMenu: true
    };
  }
  render() {
    return (
      <div className="col-12">
        <div className="footer">{this.props.hel}</div>
        <div className="footer">{this.state.oo}</div>
      </div>
    );
  }
}

export default Menu;
